        <UserMaillMessageContents>
          <UserMaillMessageContentsUser>춘향이님</UserMaillMessageContentsUser>
          <UserMaillMessageContentsText>
            아버님 저랑 같이 신나는 유기견 봉사 어떠신 가요?
          </UserMaillMessageContentsText>
        </UserMaillMessageContents>
      </UserMaillMessage>
      <UserMaillMessage>
        <UserMaillMessageCheckBox type="checkbox" />
        <UserMaillMessageContents>
          <UserMaillMessageContentsUser>춘향이님</UserMaillMessageContentsUser>
          <UserMaillMessageContentsText>
            아버님 저랑 같이 신나는 유기견 봉사 어떠신 가요?
          </UserMaillMessageContentsText>
        </UserMaillMessageContents>
      </UserMaillMessage>
    </>
  );
}
